import React, { useState } from 'react'
import { auth } from './firebase';
import { createUserWithEmailAndPassword } from 'firebase/auth';
import { Link, useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';

const Signup = () => {

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [biography, setBiography] = useState('');
  const [accountType, setType] = useState('');

  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const userCredential = await createUserWithEmailAndPassword(auth, email, password);
      console.log(userCredential);
      const user = userCredential.user;
      localStorage.setItem('token', user.accessToken);
      localStorage.setItem('user', JSON.stringify(user));
      navigate("/");
    } catch (error) {
      console.error(error);
    }
  }

  return (
    <div>
        <Navbar/>
      <h1 style={{marginTop: "150px"}}>Sign Up</h1>
      <form onSubmit={handleSubmit} className='signup-form'>
        <input
          type="email"
          placeholder="Your Email"
          required
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          style={{margin: "10px", fontSize: "15px"}}
        />
        <input
          type="password"
          placeholder="Your Password"
          required
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          style={{margin: "10px", fontSize: "15px"}}
        />
        <input
          type="biography"
          placeholder="Your Biography"
          required
          value={biography}
          onChange={(e) => setBiography(e.target.value)}
          style={{margin: "10px", fontSize: "15px"}}
        />
        <label htmlFor="type">Choose Account Type:</label>
        <select id="type" value={accountType} onChange={(e) => setType(e.target.value)} style={{margin: "5px"}} >
            <option value="Mentor">Mentor</option>
            <option value="Mentee">Mentee</option>
        </select>
        <button type="submit" className='signup-button' style={{marginLeft: "10px"}}>Sign Up</button>
      </form>
      <p>Need to Login? <Link to="/login">Login</Link></p>
    </div>
  )
}

export default Signup
